import React from 'react';
import { Link } from 'react-router-dom';
import './WorkTitle.css';


function WorkTitle({
    info_1, info_2, info_3
}) { 
    return (
        <>

            <div className="header_img">
                <img class="img_cover" src={"./images/joul/cover.jpg"} />
            </div>

        <div className="header_details">
            <div className="header_awards"></div>
            <div className="header_info">
                <div className="info_1">
                    <span className="h3_title">PROJECT DETAILS</span> <br /> <br />
                    <span className="p_text">{info_1}</span> <br />
                </div> 
                <div className="info_2">
                    <span className="h3_title">MY ROLE</span> <br /> <br />
                    <span className="p_text">{info_2}</span><br />
                </div> 
                <div className="info_3">
                    <span className="h3_title">TOOLS USED</span> <br /> <br />
                    <span className="p_text">{info_3}</span>
                </div>
            </div>
        </div>
        </>
    );
}

export default WorkTitle;
